import PopupWithForm from './PopupWithForm.js';

function ConfirmButtonPopup({ card, isOpen, onClose, onCardDelete }) {

    function handleSubmit(evt) {
        evt.preventDefault();
        
        onCardDelete();
        onClose();
    };

    return (
        <PopupWithForm
            
            isOpen={isOpen}
            onClose={onClose}
            handleSubmit={handleSubmit}
            name="confirm"
            title="Вы уверены?"
            buttonText="Да"
        />
    );
}

export default ConfirmButtonPopup;
